import{_ as t,c as o,o as s,ah as a,aT as i,aU as r,aV as l,aW as n,aX as h,aY as d,aZ as p,a_ as u,a$ as m,b0 as g,b1 as c,b2 as b,b3 as f}from"./chunks/framework.Bln8JRzz.js";const _=JSON.parse('{"title":"NANOSPORE","description":"","frontmatter":{},"headers":[],"relativePath":"farming/nanoSpore.md","filePath":"farming/nanoSpore.md"}'),k={name:"farming/nanoSpore.md"};function y(v,e,S,w,P,N){return s(),o("div",null,[...e[0]||(e[0]=[a('<h1 id="nanospore" tabindex="-1"><u><strong> NANOSPORE</strong></u> <a class="header-anchor" href="#nanospore" aria-label="Permalink to “NANOSPORE”">​</a></h1><h2 id="oestrus-—-eris-—-infested-salvage-origin-system" tabindex="-1"><u><strong> Oestrus — Eris — Infested Salvage - Origin System </strong></u> <a class="header-anchor" href="#oestrus-—-eris-—-infested-salvage-origin-system" aria-label="Permalink to “Oestrus — Eris — Infested Salvage - Origin System”">​</a></h2><ul><li><strong>Squad:</strong> 4/4</li><li><strong>Composition:</strong> 1 <a href="./../builds/khoraSteelPath">Khora</a> · 1 <a href="./../builds/novaosSp">Nova</a> · 2 <a href="./../builds/nekrososSp">Nekros</a></li></ul><hr><div class="tip custom-block"><p class="custom-block-title custom-block-title-default">TIP</p><p>We won&#39;t be playing in <strong>SP mode</strong>, we just want the <strong>cage to kill mobs</strong>.<br> You can play in SP if you like — the <strong>method and builds</strong> will be the same for <strong>Nova</strong> and <strong>Nekros</strong>, but <strong>not for Khora</strong>.</p></div><blockquote><p>It is recommended that all squad members play <strong>Power Donation</strong>.</p></blockquote><div style="margin-top:20px;"><img src="'+i+'" alt="Oestrus" style="width:75%;height:auto;"></div><h3 id="tile-sets" tabindex="-1"><u><strong> Tile Sets </strong></u> <a class="header-anchor" href="#tile-sets" aria-label="Permalink to “Tile Sets”">​</a></h3><p>Here is the location or mission we use to collect nano spores. <strong>Two tile sets</strong> are available: <strong>one that we want</strong> and the other that we ignore .To distinguish the room, we use a <strong>key indicator</strong>;</p><div class="important custom-block github-alert"><p class="custom-block-title">IMPORTANT</p><p>At the start of the mission, two waypoints will appear.</p><p>If you only see one waypoint,( to the left of the screen) abort the mission and restart it until you see two waypoints ( to the right of the screen )</p></div><div style="margin-top:20px;"><img src="'+r+'" alt="Oestrus Tile" style="width:100%;height:auto;"></div><p>Once you have found the correct tile set, <strong>one player needs to break a crate</strong> (other than the host) should leave the mission.<br> Then the host should <strong>re-invite the player</strong>. This will cause <strong>more enemies to spawn</strong>.</p><div class="danger custom-block"><p class="custom-block-title">ATTENTION</p><p><strong>2024.10 Koumei &amp; The Five Fates Now, the two yellow markers that used to indicate the correct tile are gone, so you&#39;ll need to manually check the tile each time</strong></p></div><h3 id="method-os" tabindex="-1"><u><strong> Method OS </strong></u> <a class="header-anchor" href="#method-os" aria-label="Permalink to “Method OS”">​</a></h3><div class="danger custom-block"><p class="custom-block-title">ATTENTION</p><p><strong>2024.10 Koumei &amp; The Five Fates</strong><strong>You have to place the first two serums in one console (in this case, A) to get mobs to spawn; otherwise, nothing spawns</strong></p></div><ul><li>Once the mission starts, three consoles (A, B, C) appear.</li><li><strong>Keep only Console A active</strong> — destroy B and C.</li><li>Let A <strong>degrade slowly</strong>, then <strong>use antivirus serum at ~7% health</strong>.</li><li><strong>Nekros</strong> must watch the console’s health (shown near the mini-map).</li></ul><details class="details custom-block"><summary>Why</summary><p>The reason we do this is to make the mission progress as slowly as possible to maximize the acquisition of nano spores. The method involves letting console A degrade., then start applying antivirus serum whenever the console reaches ~7% health.</p></details><div style="margin-top:20px;"><img src="'+l+'" alt="Oestrus Filling " style="width:70%;height:auto;"></div><h3 id="position-role" tabindex="-1"><u><strong> Position / Role </strong></u> <a class="header-anchor" href="#position-role" aria-label="Permalink to “Position / Role”">​</a></h3><p>Usually , <a href="./../builds/khoraOrigin">Khora</a> <strong>will place her cage as shown on the image below</strong>, but she can also place it as in the other images.</p><p>This doesn&#39;t really impact the loot at the end. The rest of the squad will always remain in the <a href="./../builds/khoraOrigin">Khora</a> cage,</p><div class="warning custom-block"><p class="custom-block-title custom-block-title-default">WARNING</p><p><strong>NEVER USE THE CENTRAL CONSOLE</strong></p></div><div style="margin-top:20px;"><img src="'+n+'" alt="Central Console " style="width:70%;height:auto;"></div><p>Some textures are considered transparent; we can use <a href="./../builds/nekrososSp">Nekros Rage</a> through them directly without needing a direct line of sight to the enemy.</p><div style="margin-top:20px;"><img src="'+h+'" alt="Oestrus invisible texture  " style="width:70%;height:auto;"></div><p><a href="./../builds/khoraOrigin">Khora</a> is the main source of DPS and loot. She will kill the ennemies with her cage. Her role in the mission is simple :</p><ul><li>Place cage in the right spot</li><li>Set venari to &quot;Heal&quot; on an ally to prevent them from running around and blocking mobs</li><li>Spam <a href="https://wiki.warframe.com/w/Magus_Anomaly" target="_blank" rel="noreferrer"><strong><strong>Magus Anomaly</strong></strong></a></li></ul><p><a href="./../builds/novaosSp">Nova</a> <strong>will increase the speed of the enemies</strong> so they run directly into Khora&#39;s cage. In the mission,</p><ul><li>Press 4 to boost the mobs&#39; speed, and that&#39;s it.</li><li>Can spam <a href="./../builds/operator#magus-anomaly">Magus Anomaly</a></li><li>Use the Helminth ability she has equipped (quiver, pull, dispensary, rage).</li></ul><p><a href="./../builds/nekrososSp">Nekros</a> <strong>allows us to re-loot killed mobs with his ability</strong> <strong>Desecrate</strong>, increasing our resource gains.</p><ul><li>Cast third ability (<em>Desecrate</em>)</li><li>Use Rage, his Helminth ability, to boost the mobs&#39;s speed and their susceptibility to damage.</li></ul><h2 id="terrorem-deimos-survival-steel-path" tabindex="-1"><u><strong> Terrorem - Deimos - Survival - Steel Path </strong></u> <a class="header-anchor" href="#terrorem-deimos-survival-steel-path" aria-label="Permalink to “Terrorem - Deimos - Survival - Steel Path”">​</a></h2><ul><li><strong>Squad:</strong> 4/4</li><li><strong>Composition:</strong> 1 <a href="./../builds/khoraSteelPath">Khora</a> · 1 <a href="./../builds/novaosSp">Nova</a> · 2 <a href="./../builds/nekrososSp">Nekros</a></li></ul><div style="margin-top:20px;"><img src="'+d+'" alt="terrorem tile  " style="width:65%;height:auto;"></div><h3 id="tile-sets-1" tabindex="-1"><u><strong> Tile Sets </strong></u> <a class="header-anchor" href="#tile-sets-1" aria-label="Permalink to “Tile Sets”">​</a></h3><p><strong>Good Tile :</strong></p><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p><em>There is no visual indicator to know if you are on the correct map; you have to do it manually and search for the right tile or use an Analyzer or another tool</em></p></div><h3 id="method-sp" tabindex="-1"><u><strong> Method SP </strong></u> <a class="header-anchor" href="#method-sp" aria-label="Permalink to “Method SP”">​</a></h3><p><a href="./../builds/khoraSteelPath">Khora</a> should place her Strangledome exactly as shown in the screenshot below.</p><div style="margin-top:20px;"><img src="'+p+'" alt="Terrorem Khora Placement " style="width:90%;height:auto;"></div><ul><li><p><a href="./../builds/novaosSp">Nova</a> will press 4 to <strong>speed up</strong> ennemies so they quickly get trapped inside the dome. She can also use her subsumed ability (<strong>Rage or Cloak</strong>), but it&#39;s optional.</p></li><li><p><a href="./../builds/nekrososSp">Nekros</a> will use Desecrate to re-roll enemy drops and increase loot.</p></li></ul><p>Among the two Nekros, one <strong>must</strong> use — this is mandatory. The second Nekros can choose to run something else, such as <a href="./../builds/nekrososSp#pull">Pull</a>, <a href="./../builds/nekrososSp#rage">Rage</a>, or <a href="./../builds/nekrososSp#petrify">Petrify</a>, depending on preference.</p><p>All squad members should stay grouped together at the designated location (as shown in the screenshots below).</p><div style="margin-top:20px;"><img src="'+u+'" alt="Terrorem Squad placement   " style="width:90%;height:auto;"></div><p><em>SPAWN LOCATION FOR NEKROS PULL</em></p><div style="margin-top:20px;"><img src="'+m+'" alt="Terrorem Nekros Placement   " style="width:90%;height:auto;"></div><h3 id="position-role-1" tabindex="-1"><u><strong> Position - Role </strong></u> <a class="header-anchor" href="#position-role-1" aria-label="Permalink to “Position - Role”">​</a></h3><p><a href="./../builds/khoraSteelPath">Khora</a> is the main source of DPS and loot.</p><ul><li>Kill enemies with her whip <a href="./../builds/khoraSteelPath#khora-steel-path">Steel Path Build</a></li><li>Wait for the enemies to be petrified; <strong>do not spam the ability</strong>.</li><li>Place her cage in the right spots,</li><li>Set Venari to &#39;Heal&#39; on an ally to prevent them from moving around and blocking enemies.</li></ul><p><a href="./../builds/novaosSp">Nova</a> will increase the speed of the enemies so they run directly into Khora&#39;s cage.</p><ul><li>Press 4 to boost the enemies&#39; speed,</li><li>Can also spam <a href="./../builds/operator#magus-anomaly">Magus Anomaly</a>.</li></ul><p><a href="./../builds/nekrososSp">Nekros</a> allows us to re-loot killed enemies with his ability <strong>Desecrate</strong>, thus increasing our resource gains. In the mission, Nekros will use his 3 (Desecrate) and his Helminth ability:</p><ul><li><a href="./../builds/nekrososSp#pull">Pull</a> to bring enemies into the cage or unstick them,</li><li><a href="./../builds/nekrososSp#petrify">Petrify</a> for additional loot (Khora needs to wait for your petrification before killing the enemies). <em>This method is much harder to set</em></li></ul><h2 id="zabala-eris-survival-dark-sector-steel-path" tabindex="-1"><u><strong> Zabala - Eris - Survival (Dark Sector) - Steel Path </strong></u> <a class="header-anchor" href="#zabala-eris-survival-dark-sector-steel-path" aria-label="Permalink to “Zabala - Eris - Survival (Dark Sector) - Steel Path”">​</a></h2><ul><li><strong>Squad:</strong> 4/4</li><li><strong>Composition:</strong> 1 <a href="./../builds/khoraSteelPath">Khora</a> · 1 <a href="./../builds/novaosSp">Nova</a> · 2 <a href="./../builds/nekrososSp">Nekros</a></li></ul><div style="margin-top:20px;"><img src="'+g+'" alt="Zabala Right Tile   " style="width:90%;height:auto;"></div><h3 id="tile-sets-2" tabindex="-1"><u><strong> Tile Sets </strong></u> <a class="header-anchor" href="#tile-sets-2" aria-label="Permalink to “Tile Sets”">​</a></h3><p><strong>Good Tile :</strong></p><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p><em>There is no visual indicator to know if you are on the correct map; you have to do it manually and search for the right tile or use an Analyzer or another tool</em></p></div><h3 id="method-sp-1" tabindex="-1"><u><strong> Method SP </strong></u> <a class="header-anchor" href="#method-sp-1" aria-label="Permalink to “Method SP”">​</a></h3><ul><li><a href="./../builds/khoraSteelPath">Khora</a> will place her cage approximately in the same spot as shown in the screenshot.</li></ul><p><a href="./../builds/novaosSp">Nova</a> will need to place a med tower above the cage. <a href="./../builds/nekrososSp">Nekros</a> will stand on the med tower and use Pull. <a href="./../builds/novaosSp">Nova</a>will put cloak on the med tower to prevent the <a href="./../builds/nekrososSp">Nekros</a> from being targeted by the mobs.</p><p>We can place one <a href="./../builds/nekrososSp#pull">Nekros Pull</a> on the med tower and keep one <a href="./../builds/nekrososSp#petrify">Nekros Petrify</a> near the cage; he will petrify the enemies each time the mobs are pulled into the cage.</p><div style="margin-top:20px;"><img src="'+c+'" alt="Zabala Khora Placement  " style="width:90%;height:auto;"></div><p><em>SPAWN LOCATION FOR NEKROS PULL</em></p><div style="margin-top:20px;"><img src="'+b+'" alt="Zabala Nekros Placement  " style="width:90%;height:auto;"></div><div style="margin-top:20px;"><img src="'+f+'" alt="Zabala Nekros Placement 2  " style="width:90%;height:auto;"></div><p><em>TOWER PLACEMENT WITH NOVA</em></p><ul><li>Double Jump</li><li>AimGlide - Down</li><li>Press Antimatter keybind</li><li>Press MedTower keybind</li></ul><blockquote><p>TODO : Ajouter la video de nova</p></blockquote><p><em>To get the med tower, you just need to obtain the MANTIS.</em><em>Then press Escape ➛ Orbiter ➛ Landing Craft ➛ Air Support ➛ Select Med-Tower</em></p><p><em>Position Nekros Pettrify</em></p><blockquote><p>TODO : Ajouter la video de Nekros petrify</p></blockquote><h3 id="position-role-2" tabindex="-1"><u><strong> Position - Role </strong></u> <a class="header-anchor" href="#position-role-2" aria-label="Permalink to “Position - Role”">​</a></h3><p><a href="./../builds/khoraSteelPath">Khora</a> is the main source of DPS and loot.</p><ul><li>Kill enemies with her whip <a href="./../builds/khoraSteelPath">Steel Path</a>.</li><li>Wait for the enemies to be petrified; do not spam the ability.</li><li>Place her cage in the right spots,</li><li>Set Venari to &#39;Heal&#39; on an ally to prevent them from moving around and blocking enemies.</li></ul><p><a href="./../builds/novaosSp">Nova</a> will increase the speed of the enemies so they run directly into Khora&#39;s cage.</p><ul><li>Press 4 to boost the enemies&#39; speed,</li><li>Place her med tower for the <strong>Nekro</strong>s while granting them invisibility with <a href="./../builds/novaosSp#quiver">Quiver</a>.</li><li>Can spam Magus Anomaly.</li></ul><p><a href="./../builds/nekrososSp">Nekros</a> allows us to re-loot killed enemies with his ability <strong>Desecrate</strong> thus increasing our resource gains.</p><ul><li>Use third ability (Desecrate) and his Helminth ability:</li><li><a href="./../builds/nekrososSp#pull">Pull</a> to bring enemies into the cage or unstick them,</li><li><a href="./../builds/nekrososSp#petrify">Petrify</a> for additional loot (Khora needs to wait for your petrification before killing the enemies). <em>This method is much harder to set up</em></li></ul>',80)])])}const O=t(k,[["render",y]]);export{_ as __pageData,O as default};
